    <div className="App">
      <div className="black-nav">
        <h4 style={ {color : 'blue', fontSize : '16px'} }>{ logo }</h4>
      </div>
      <div className='list'>
        <h4>{ 글제목 }</h4>
        <p>2월 17일 발행</p>
      </div>
    </div>
  );
}

export default App;
